INSERT INTO bulletin (title, creater, content, status_id,created_at) 
VALUES 
('一些銀行操作清晰地...', '張三', '某些旅行書籍夜晚。只有家長提供可能的風格問題與。行業主題自己得到。簡單的健康準備會。公司教堂迅速的主管擔心走路。將攻擊銀行電視機身玻璃壞的站立。', 1,GETDATE()),
('操作水比最終數百萬。', '李四', '注意下一步挑戰策略單位通過興趣。男孩土地似乎雖然有百，切割。提前健康肯定的來源正確。女兒坐下藍色財產。提前突然投票開放風格。', 1,GETDATE()),
('報告地面來源。', '小明', '比率先生興趣框賬戶小於。執行食物步驟演講孩子以來。行為現在實現笑。春季兄弟可能是是能力的幾個。', 1,GETDATE()),
('南方通常面對的月份。', '王五', '將繼續接近特別的狀況。總統狀況然後。情況場地給出的觀點。前進的建議專業水。', 1,GETDATE()),
('我向著方法步伐球。', '趙六', '一塊屬於我們的財產。離開一般的花園證據試驗這裡。手可能是打電話的重音不同的音樂已經。空氣等會相同的揭示。', 1,GETDATE()),
('士兵建立經濟房屋增加兒童。', '李六', '陳述改善恐懼觀眾。歌唱尋找我們。常規的經理。教師社會個人主題希望。', 1,GETDATE()),
('繼續前進的女孩巨大。', '孫七', '協議發火壞的提到。某人框架槍為什麼拋掷土地第一次。協議是否能短期政府創造投資。床上是很好的標準存在。成年人時候更好的步伐地址演講。', 1,GETDATE()),
('需要關係角色的一分鐘的關鍵。', '大六', '自然長時間。請問岩石候選人。練習的差異建立發現。談論為什麼藍色公司尋找藍色對抗。', 1,GETDATE()),
('民主自己總是中心的星期增加會議。', '張三', '人類總體語音傍晚賣。總是資本。推動飛行任何旅行帶來。謝謝大部分目標十個表面。', 1,GETDATE()),
('麻煩行走反映站立的戰鬥。', '趙一', '當前重的社會單身。課程城鎮全會交易計數。家庭八的人可能是全。東西表面處理感覺到的感覺片段安全。哪些故事三個名字富有。', 1,GETDATE());
